import React, { Component } from 'react';
import './App.css';

class App extends Component {
  constructor(props) {
    super(props);

    this.state = {
      todos: [],
      todo: ''
    };
  }

  render() {
    return (
      <div className='App'>
        <h1>Todo List App</h1>
        <input onChange={this.updateToDo} type='text' />
      </div>
    );
  }
}

export default App;
